import React, { useState } from "react";
import { ItemsList } from "./Items-list";
import { ItemsPrices } from "./items-prices";
import SaveItemsModal from "./saveItemsModal";

const Toggle = () => {
  const [toggle, setToggle] = useState(false);
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [selectedItems, setSelectedItems] = useState([]);
  const [selectedItemData, setSelectedItemData] = useState([]);

  const handleToggle = () => {
    setToggle(!toggle);
  };

  const handleOpenModal = () => {
    setIsModalOpen(true);
  };

  const handleCloseModal = () => {
    setIsModalOpen(false);
  };

  const handleItemChange = (title, quantity, data) => {
    const existingItem = selectedItems.find((item) => item.title === title);

    if (existingItem) {
      const updatedItems = selectedItems.map((item) =>
        item.title === title ? { ...item, quantity, data } : item
      );
      setSelectedItems(updatedItems);
    } else {
      setSelectedItems([...selectedItems, { title, quantity, data }]);
    }
  };

  const handleSaveItems = (customerId, name, phoneNumber, address) => {
    // Perform any necessary actions with the saved items
    console.log(
      "Save items:",
      customerId,
      name,
      phoneNumber,
      address,
      selectedItems
    );
    handleCloseModal();
  };

  const renderItemsList = () => (
    <div className="sections-container">
      <div className="section">
        <h1>Ropa Personal</h1>
        <div className="items-list-container">
          <ItemsList
            title="Playeras/Blusas"
            onItemChange={handleItemChange}
          />
          <ItemsList title="Short/Bermudas" onItemChange={handleItemChange} />
          <ItemsList title="Polos" onItemChange={handleItemChange} />
          <ItemsList title="Camisas" onItemChange={handleItemChange} />
          <ItemsList title="Calzones/Boxers" onItemChange={handleItemChange} />
          <ItemsList title="Sostenes" onItemChange={handleItemChange} />
          <ItemsList title="Jeans" onItemChange={handleItemChange} />
          <ItemsList title="Leggins" onItemChange={handleItemChange} />
          <ItemsList title="Overol" onItemChange={handleItemChange} />
          <ItemsList title="Faldas" onItemChange={handleItemChange} />
          <ItemsList title="Vestidos" onItemChange={handleItemChange} />
          <ItemsList
            title="Toalla Corporal"
            onItemChange={handleItemChange}
          />
          <ItemsList title="Toalla Facial" onItemChange={handleItemChange} />
          <ItemsList title="Toalla Mano" onItemChange={handleItemChange} />
          <ItemsList
            title="Calcetines (Por Pza)"
            onItemChange={handleItemChange}
          />
        </div>
      </div>
      <div className="section">
        <h1>Ropa de Cama</h1>
        <div className="items-list-container">
          <ItemsList title="Sabanas Planas" onItemChange={handleItemChange} />
          <ItemsList
            title="Sabanas de Cajon"
            onItemChange={handleItemChange}
          />
          <ItemsList
            title="Edredon Individual"
            onItemChange={handleItemChange}
          />
          <ItemsList
            title="Edredon Matrimonial"
            onItemChange={handleItemChange}
          />
          <ItemsList
            title="Edredon Queen Size"
            onItemChange={handleItemChange}
          />
          <ItemsList
            title="Edredon King Size"
            onItemChange={handleItemChange}
          />
          <ItemsList
            title="Cobija Individual/Matrimonial"
            onItemChange={handleItemChange}
          />
          <ItemsList
            title="Cobija Queen/King Size"
            onItemChange={handleItemChange}
          />
          <ItemsList title="Forro Duvet" onItemChange={handleItemChange} />
          <ItemsList
            title="Duvet Individual/Matrimonial"
            onItemChange={handleItemChange}
          />
          <ItemsList
            title="Duvet Queen/King Size"
            onItemChange={handleItemChange}
          />
          <ItemsList title="Almohada Chica" onItemChange={handleItemChange} />
          <ItemsList
            title="Almohada Mediana"
            onItemChange={handleItemChange}
          />
          <ItemsList
            title="Almohada Grande"
            onItemChange={handleItemChange}
          />
        </div>
      </div>
    </div>
  );

  const renderPricesList = () => (
    <div className="sections-container">
      <div className="section">
        <h1>Ropa Personal</h1>
        <div className="items-list-container">
          <ItemsPrices title="Short/Bermudas" price={45} />
          <ItemsPrices title="Playeras/Blusas" price={45} />
          <ItemsPrices title="Polos" price={45} />
          <ItemsPrices title="Camisas" price={45} />
          <ItemsPrices title="Calzones/Boxers" price={45} />
          <ItemsPrices title="Sostenes" price={45} />
          <ItemsPrices title="Jeans" price={45} />
          <ItemsPrices title="Leggins" price={45} />
          <ItemsPrices title="Overol" price={45} />
          <ItemsPrices title="Faldas" price={45} />
          <ItemsPrices title="Vestidos" price={45} />
          <ItemsPrices title="Toalla Corporal" price={45} />
